import React from "react";
import styled from "styled-components";



const HeaderStyled = styled.HeaderStyled `
 background: blue;


`

export const Header = ()=>{
    return(
        <HeaderStyled>
            <img src="https://assets.pokemon.com/assets/cms2-pt-br/img/misc/gus/buttons/logo-pokemon-79x45.png" alt="pokemom"/>
        </HeaderStyled>

    )
}
